import React from "react";

export default function About() {
  return (
    <section id="about" className="py-16 px-6 bg-gray-100 text-center">
      <h2 className="text-3xl font-bold mb-6">About Us</h2>
      <p className="max-w-2xl mx-auto text-slate-700">
        At CG-ProTech, we are passionate about helping businesses thrive with cutting-edge cloud and infrastructure solutions.
        Our team ensures reliability, security, and performance in every project we deliver.
      </p>
    </section>
  );
}
